import { faMinus, faPlus, faTrash } from "@fortawesome/free-solid-svg-icons";

const ModalKeranjang = (props) => {
	const { handleClose,
		showModal,
		keranjangDetail,
		keterangan,
		tambah,
		kurang,
		jumlah,
		changeHandler,
		handleSubmit,
		totalHarga,
		hapusPesanan
	} = props

	if (keranjangDetail) {
		return (
			<Modal show={showModal} onHide={handleClose}>
				<Modal.Header closeButton>
					<Modal.Title>
						<h1>ramadhan</h1>
					</Modal.Title>
				</Modal.Header>
				<Modal.Body>
					<h1>ramadhan</h1>
				</Modal.Body>

				<Modal.Footer>
					<h1>ramadhan</h1>
				</Modal.Footer>
			</Modal>
		);
	} else {
		return false
	}
};

export default ModalKeranjang;
